deps.context:
cpmaddpackage(
    name boost
    url ${boost_url}
    url_hash sha256=${boost_url_sha256}
    download_only on
)

cpmaddpackage(
        name ${name}
        url https://anaconda.org/intel/${name}/${mkl_version}/download/linux-64/${${name}-linux-64-file}
        url_md5 ${${name}-linux-64-md5}
    )

cpmaddpackage(
    name tinygltf
    url ${tinygltf_url}
    download_no_extract 1
    download_only on
)
